import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
  import FavoriteVendorsTable from '../FavoriteVendorsTable/FavoriteVendorsTable';
import About from '../About/About';

  export default function Farmbar() {
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link style={{textDecoration:"none"}} to="/">Home</Link>
              </li>
              <li>
                <Link to="/users">Users Content</Link>
              </li>
              <li>
                <Link to="/about">About Farmâ€¢gistic</Link>
              </li>
            </ul>
          </nav>

          {/* A <Switch> looks through its children <Route>s and
              renders the first one that matches the current URL. */}
          <Switch>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/users">
              <Users />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }

  function Home() {
    return <FavoriteVendorsTable />
    ;
  }

  function ShowAbout() {
    return <About />;
  }

  function Users() {
    return (
        <>
    <h2>Users displays different content depending on your authorization.</h2>
        <h3>Search Markets</h3>
        <h2>List of results</h2>
        <button>Go to Map</button>
        </>
    );
  }
